import React from "react";
import UserCard from "../../ui/user-card/user-card.jsx";
import MenuLink from "../../ui/menu-link/menu-link.jsx";
import styles from "./user-menu.module.scss";
import Icons from "../../icons/icons.jsx";

function UserMenu (props) {

    return (
    <div className={styles.wrapper}> 
        <UserCard  username="Roman Kutepov"  position="Brain Director"/>
        <div>  
            <ul className={styles.list}> 
                <li> <Icons name="dashboard" color="rgba(102, 120, 138, 1)" size="24" className='button-left-panel'/> <MenuLink  href="#" text="Dashboard" /> </li>
                <li> <MenuLink  href="#" text="Users" /> </li>
                <li> <MenuLink  href="#" text="Products" /> </li>
                <li> <MenuLink  href="#" text="Authentication" /> </li>
                <li> <MenuLink href="#" text="Typography" /> </li>
                <li> <MenuLink href="#" text="Icons Images" /> </li>
            </ul>
            <h3 className={styles.title}> Support </h3>
            <ul className={styles.list}> 
                <li> <MenuLink  href="#" text="Support" /> </li>
            </ul>
        </div>
    </div>
    );
};

export default UserMenu;
